import React from 'react';

const Listing = (props) => {
  const {
    available, 
    city, 
    condition,  
    list_name, 
    price, 
    seller,
    contact_info
  } = props;
  
  return (
    <section
      style={{
        width: '600px',
        padding: '20px',
        display: 'flex',
        flexWrap: 'wrap',
        border: '1px solid black',
        borderBottom: '0px solid black'
      }}
    >
      <span
        style={{
          margin: '5px'
        }}
      >1</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Name:</b> {`${list_name}`}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Seller:</b> {`${seller}`}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Condition:</b> {`${condition}`}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Price:</b> 	&pound;{` ${price}`}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>City:</b> {`${city}`}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Available:</b> {available ? (<>Yes</>) : (<>No</>)}</span>
      <span
        style={{
          margin: '5px'
        }}
      ><b>Seller Contact:</b> {`${contact_info}`}</span>
    </section>
  )
};

export default Listing;
